import React from "react";
import {useDispatch, useSelector} from "react-redux";
import {getEmailUs} from "../actions/emailUs.action";
import TableContainer from "@material-ui/core/TableContainer/TableContainer";
import Table from "@material-ui/core/Table/Table";
import TableHead from "@material-ui/core/TableHead/TableHead";
import TableRow from "@material-ui/core/TableRow/TableRow";
import TableCell from "@material-ui/core/TableCell/TableCell";
import TableBody from "@material-ui/core/TableBody/TableBody";
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Button from "@material-ui/core/Button/Button";
import EnhancedTable from "./AdminTable";


const useStyles = makeStyles({
    table: {
        minWidth: 650,
    },
});

const AdminEu = () => {


    const classes = useStyles();

    const dispatch = useDispatch();

    const adminEuState = useSelector(appState => {
        return {
            eu: appState.eu,
            // tr: appState.tr
        };
    });

    const getUnhandledEu = (event) => {
        event.preventDefault();
        dispatch(getEmailUs());

    };




    return (
            <div>
                    <Button onClick = {getUnhandledEu}>Show unhandled emails</Button>
            <TableContainer component={Paper}>
                <Table className={classes.table} aria-label="simple table">
                    <TableHead>
                        <TableRow>
                            <TableCell>First Name</TableCell>
                            <TableCell align="right">Last Name</TableCell>
                            <TableCell align="right">Email</TableCell>
                            <TableCell align="right">Phone</TableCell>
                            <TableCell align="right">Date</TableCell>
                            <TableCell align="right">Status</TableCell>
                            <TableCell align="right">Message</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {
                            adminEuState.eu ?
                                adminEuState.eu.map((element) => (
                                    <TableRow key={element.id}>
                                        <TableCell component="th" scope="row">
                                            {element.firstname}
                                        </TableCell>
                                        <TableCell align="right">{element.lastname}</TableCell>
                                        <TableCell align="right">{element.email}</TableCell>
                                        <TableCell align="right">{element.phone}</TableCell>
                                        <TableCell align="right">{element.date}</TableCell>
                                        <TableCell align="right">{element.status}</TableCell>
                                        <TableCell align="right">{element.message}</TableCell>
                                    </TableRow>
                                ))
                            :
                            <span></span>
                        }
                    </TableBody>
                </Table>
            </TableContainer>

                <EnhancedTable/>
        </div>

    );

}

export default AdminEu;
